void fileCallback(std::shared_ptr<HTTPRequest> request)
{
  const char* data;
  size_t size;
  std::string fileName = request->params("file_url");
  std::cerr << fileName << std::endl;
  MIMEType type = MIME_TYPE_NOT_SPECIFIED;
  if (fileName == "index.html")
  {
    type = MIME_TEXT_HTML;
    size = std::strlen(indexHTML);
    data = indexHTML;
  }
  else if (fileName == "style.css")
  {
    type = MIME_TEXT_CSS;
    size = styleCSSSize;
    data =  (char*)styleCSS;
  }
  else if (fileName == "script.js")
  {
    type = MIME_TEXT_JAVASCRIPT;
    size = scriptJSSize;
    data =  (char*)scriptJS;
  }
  else if (fileName == "jquery.min.js")
  {
    request->addResponseHeaderParameter("content-encoding", "gzip");
    type = MIME_TEXT_JAVASCRIPT;
    size = jqueryMinJSSize;
    data =  (char*)jqueryMinJS;
  }
  else if (fileName == "bootstrap.min.js")
  {
    request->addResponseHeaderParameter("content-encoding", "gzip");
    type = MIME_TEXT_JAVASCRIPT;
    size = bootstrapMinJSSize;
    data =  (char*)bootstrapMinJS;
  }
  else if (fileName == "bootstrap.min.css")
  {
    request->addResponseHeaderParameter("content-encoding", "gzip");
    type = MIME_TEXT_CSS;
    size = bootstrapMinCSSSize;
    data =  (char*)bootstrapMinCSS;
  }
  else
    throw HTTPException(HTTP_FORBIDDEN);
  request->sendResponseHeader(HTTP_OK, type);
  request->Send(data, size);
}
